CREATE DEFINER=`root`@`localhost` PROCEDURE `GenerateStockData` ()   BEGIN
    DECLARE i INT DEFAULT 0;
    DECLARE start_date DATE;
    DECLARE curr_date DATE;
    
    SET start_date = DATE_SUB(CURDATE(), INTERVAL 30 DAY);
    
    -- Loop 30 days (History) + 7 days (Future)
    WHILE i < 37 DO
        SET curr_date = DATE_ADD(start_date, INTERVAL i DAY);
        
        -- Insert Stock Data for ALL companies based on a random walk from a base price
        SELECT 
            symbol, 
            curr_date,
            -- Random Maths to simulate price
            (RAND() * 100) + 50 as last, 
            ((RAND() * 100) + 50) * 0.99 as open,
            ((RAND() * 100) + 50) * 1.02 as high,
            ((RAND() * 100) + 50) * 0.98 as low,
            FLOOR(RAND() * 5000000) as volume,
            ((RAND() * 100) + 50) * 1.01 as pred_close,
            ((RAND() * 100) + 50) * 0.95 as confidence_lower,
            ((RAND() * 100) + 50) * 1.05 as confidence_upper
        FROM companies
        WHERE NOT EXISTS (SELECT 1 FROM stocks WHERE date = curr_date AND stocks.symbol = companies.symbol);
        
        -- Insert Index Data
        SELECT 
            curr_date,
            78000 + (RAND() * 1000),
            78000 + (RAND() * 1000),
            79000,
            77000,
            78500
        WHERE NOT EXISTS (SELECT 1 FROM kse_index WHERE date = curr_date);

        SET i = i + 1;
    END WHILE;
END$$

